// File: contracts/SafeStakeRegistry.sol
// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity ^0.8.2;

import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "./utils/VersionedContract.sol";
import "./utils/Types.sol";
import "./ISafeStakeRegistry.sol";

contract SafeStakeRegistry is Initializable, OwnableUpgradeable, ISafeStakeRegistry, VersionedContract {
    using Counters for Counters.Counter;
    using Types256 for uint256;
    using Types64 for uint64;

    struct Operator {
        string name;
        bytes publicKey;
        uint64 fee;
        address ownerAddress;
        uint32 score;
        uint32 indexInOwner;
        uint32 validatorCount;
        bool active;
        bool fromParaStateDao;
    }

    struct Validator {
        uint32[] operatorIds;
        address ownerAddress;
        uint32 indexInOwner;
        bool active;
    }

    struct OwnerData {
        uint32 activeValidatorCount;
        bool validatorsDisabled;
        bytes[] validators;
    }

    struct Initiator {
        address ownerAddress;
        uint32[] operatorIds;
        bytes validatorPublicKey;
        address miniPoolAddress;
        InitiatorStatus status;
        bool active;
    }

    Counters.Counter private _lastOperatorId;
    Counters.Counter private _lastInitiatorId;

    mapping(uint32 => Operator) private _operators;
    mapping(bytes => Validator) private _validators;
    mapping(address => uint32[]) private _operatorsByOwnerAddress;
    mapping(address => OwnerData) private _owners;
    mapping(address => uint32[]) private _initiatorsByOwnerAddress;
    mapping(uint32 => Initiator) private _initiators;

    uint32 private _activeValidatorCount;

    uint32 constant private VALIDATORS_PER_OPERATOR_LIMIT = 2000;
    uint32 constant private REGISTERED_OPERATORS_PER_ACCOUNT_LIMIT = 10;

    uint256 private _operatorFee;
    /**
     * @dev See {ISafeStakeRegistry-initialize}.
     */
    function initialize(uint256 operatorFee) external override initializer {
        __SafeStakeRegistry_init(operatorFee);
    }

    function __SafeStakeRegistry_init(uint256 operatorFee) internal onlyInitializing {
        __Ownable_init_unchained();
        __SafeStakeRegistry_init_unchained();
        _operatorFee = operatorFee;
    }

    function __SafeStakeRegistry_init_unchained() internal onlyInitializing {
    }

    /**
     * @dev See {ISafeStakeRegistry-registerOperator}.
     */
    function registerOperator(
        string calldata name,
        address ownerAddress,
        bytes calldata publicKey
    ) external onlyOwner override returns (uint32 operatorId) {

        if (_operatorsByOwnerAddress[ownerAddress].length >= REGISTERED_OPERATORS_PER_ACCOUNT_LIMIT) {
            revert ExceedRegisteredOperatorsByAccountLimit();
        }

        if (_owners[ownerAddress].validators.length != 0) {
            revert AddressUsedByValidator();
        }

        _lastOperatorId.increment();
        operatorId = uint32(_lastOperatorId.current());
        _operators[operatorId] = Operator({name: name, ownerAddress: ownerAddress, publicKey: publicKey, score: 0, fee: 0, active: true, indexInOwner: uint32(_operatorsByOwnerAddress[ownerAddress].length), validatorCount: 0, fromParaStateDao: false});
        _operatorsByOwnerAddress[ownerAddress].push(operatorId);

    }

    /**
     * @dev See {ISafeStakeRegistry-removeOperator}.
     */
    function removeOperator(
        uint32 operatorId
    ) external onlyOwner override {
        Operator storage operator = _operators[operatorId];

        if (!operator.active) {
            revert OperatorDeleted();
        }

        operator.active = false;

        emit OperatorRemoval(operatorId, operator.ownerAddress);
    }

    /**
     * @dev See {ISafeStakeRegistry-certifyOperatorFromDao}.
     */
    function certifyOperatorFromDao(uint32 operatorId) external onlyOwner override {
        Operator storage operator = _operators[operatorId];
        if (!operator.active) {
            revert OperatorDeleted();
        }

        operator.fromParaStateDao = true;
    }

    /**
     * @dev See {ISafeStakeRegistry-updateOperatorFee}.
     */
    function updateOperatorFee(uint64 fee) external onlyOwner override {
        _updateOperatorFeeUnsafe(fee);
    }

    /**
     * @dev See {ISafeStakeRegistry-updateOperatorScore}.
     */
    function updateOperatorScore(uint32 operatorId, uint32 score) external onlyOwner override {
        Operator storage operator = _operators[operatorId];
        operator.score = score;
    }

    /**
     * @dev See {ISafeStakeRegistry-registerValidator}.
     */
    function registerValidator(
        address ownerAddress,
        bytes calldata publicKey,
        uint32[] calldata operatorIds,
        bytes[] calldata sharesPublicKeys,
        bytes[] calldata sharesEncrypted
    ) external onlyOwner override {
        _validateValidatorParams(
            publicKey,
            operatorIds,
            sharesPublicKeys,
            sharesEncrypted
        );

        if (_validators[publicKey].ownerAddress != address(0)) {
            revert ValidatorAlreadyExists();
        }

        if (_operatorsByOwnerAddress[ownerAddress].length != 0) {
            revert AddressUsedByOperator();
        }

        _validators[publicKey] = Validator({
            operatorIds: operatorIds,
            ownerAddress: ownerAddress,
            indexInOwner: uint32(_owners[ownerAddress].validators.length),
            active: true
        });

        _owners[ownerAddress].validators.push(publicKey);

        for (uint32 index = 0; index < operatorIds.length; ++index) {
            if (!_operators[operatorIds[index]].active) {
                revert OperatorDeleted();
            }

            if (++_operators[operatorIds[index]].validatorCount > VALIDATORS_PER_OPERATOR_LIMIT) {
                revert ExceedValidatorLimit();
            }
        }
        ++_activeValidatorCount;
    }

    /**
     * @dev See {ISafeStakeRegistry-removeValidator}.
     */
    function removeValidator(
        bytes calldata publicKey
    ) external onlyOwner override {
        Validator storage validator = _validators[publicKey];

        for (uint32 index = 0; index < validator.operatorIds.length; ++index) {
            --_operators[validator.operatorIds[index]].validatorCount;
        }

        bytes[] storage ownerValidators = _owners[validator.ownerAddress].validators;

        ownerValidators[validator.indexInOwner] = ownerValidators[ownerValidators.length - 1];
        _validators[ownerValidators[validator.indexInOwner]].indexInOwner = validator.indexInOwner;
        ownerValidators.pop();

        --_activeValidatorCount;

        delete _validators[publicKey];
    }

    /**
     * @dev See {ISafeStakeRegistry-registerInitiator}.
     */
    function registerInitiator(
        uint32[] calldata operatorIds
    ) external onlyOwner override returns (uint32 initiatorId) {
        if (!_checkTwoOperatorsFromParaDao(operatorIds)) {
            revert NotEnoughParaStateDaoOperators();
        }
        if (_operators[operatorIds[0]].ownerAddress != msg.sender) {
            revert InitiatorIsNotOperator();
        }
        _lastInitiatorId.increment();
        initiatorId = uint32(_lastInitiatorId.current());
        _initiators[initiatorId] = Initiator({
            ownerAddress: msg.sender,
            operatorIds: operatorIds,
            validatorPublicKey: new bytes(0),
            miniPoolAddress: address(0),
            status: InitiatorStatus.INITIALIZING,
            active: true
        });
        _initiatorsByOwnerAddress[msg.sender].push(initiatorId);
        emit InitiatorRegistration(initiatorId, msg.sender, operatorIds);
    }

    function enableOwnerValidators(address ownerAddress) external onlyOwner override {
        _activeValidatorCount += _owners[ownerAddress].activeValidatorCount;
        _owners[ownerAddress].validatorsDisabled = false;
    }

    function disableOwnerValidators(address ownerAddress) external onlyOwner override {
        _activeValidatorCount -= _owners[ownerAddress].activeValidatorCount;
        _owners[ownerAddress].validatorsDisabled = true;
    }

    function isLiquidated(address ownerAddress) external view override returns (bool) {
        return _owners[ownerAddress].validatorsDisabled;
    }

    /**
     * @dev See {ISafeStakeRegistry-operators}.
     */
    function getOperatorById(uint32 operatorId) external view override returns (string memory, address, bytes memory, uint256, uint256, uint256, bool) {
        Operator storage operator = _operators[operatorId];
        return (operator.name, operator.ownerAddress, operator.publicKey, _operators[operatorId].validatorCount, operator.fee.expand(), operator.score, operator.active);
    }

    /**
     * @dev See {ISafeStakeRegistry-getOperatorsByOwnerAddress}.
     */
    function getOperatorsByOwnerAddress(address ownerAddress) external view override returns (uint32[] memory) {
        return _operatorsByOwnerAddress[ownerAddress];
    }

    /**
     * @dev See {ISafeStakeRegistry-getOperatorsByValidator}.
     */
    function getOperatorsByValidator(bytes calldata validatorPublicKey) external view override returns (uint32[] memory operatorIds) {
        Validator storage validator = _validators[validatorPublicKey];

        return validator.operatorIds;
    }

    /**
     * @dev See {ISafeStakeRegistry-getOperatorOwner}.
     */
    function getOperatorOwner(uint32 operatorId) external view override returns (address) {
        return _operators[operatorId].ownerAddress;
    }

    /**
     * @dev See {ISafeStakeRegistry-getOperatorFee}.
     */
    function getOperatorFee(uint32 operatorId) external view override returns (uint256) {
        if (!_operators[operatorId].active) {
            return 0;
        }
        return _operatorFee;
    }

    /**
     * @dev See {ISafeStakeRegistry-activeValidatorCount}.
     */
    function activeValidatorCount() external view override returns (uint32) {
        return _activeValidatorCount;
    }

    /**
     * @dev See {ISafeStakeRegistry-validators}.
     */
    function validators(bytes calldata publicKey) external view override returns (address, bytes memory, bool) {
        Validator storage validator = _validators[publicKey];

        return (validator.ownerAddress, publicKey, validator.active);
    }

    /**
     * @dev See {ISafeStakeRegistry-getValidatorsByAddress}.
     */
    function getValidatorsByAddress(address ownerAddress) external view override returns (bytes[] memory) {
        return _owners[ownerAddress].validators;
    }

    /**
     * @dev See {ISafeStakeRegistry-getValidatorOwner}.
     */
    function getValidatorOwner(bytes calldata publicKey) external view override returns (address) {
        return _validators[publicKey].ownerAddress;
    }

    /**
     * @dev See {ISafeStakeRegistry-validatorsPerOperatorCount}.
     */
    function validatorsPerOperatorCount(uint32 operatorId) external view override returns (uint32) {
        return _operators[operatorId].validatorCount;
    }

    /**
     * @dev See {ISafeStakeRegistry-updateOperatorFee}.
     */
    function _updateOperatorFeeUnsafe(uint64 fee) private {
        _operatorFee = fee;
    }

    /**
     * @dev Validates the paramss for a validator.
     * @param publicKey Validator public key.
     * @param operatorIds Operator operatorIds.
     * @param sharesPublicKeys Shares public keys.
     * @param encryptedKeys Encrypted private keys.
     */
    function _validateValidatorParams(
        bytes calldata publicKey,
        uint32[] calldata operatorIds,
        bytes[] calldata sharesPublicKeys,
        bytes[] calldata encryptedKeys
    ) private pure {
        if (publicKey.length != 48) {
            revert InvalidPublicKeyLength();
        }
        if (
            operatorIds.length != sharesPublicKeys.length ||
            operatorIds.length != encryptedKeys.length ||
            operatorIds.length < 4 || operatorIds.length % 3 != 1
        ) {
            revert OessDataStructureInvalid();
        }
    }

    function version() external pure override returns (uint32) {
        return 1;
    }

    /**
     * @dev See {ISafeStakeRegistry-getInitiatorById}.
     */
    function getInitiatorById(uint32 initiatorId) external view override returns (address ownerAddress, uint32[] memory operatorIds, bytes memory validatorPublicKey, address minipoolAddress, InitiatorStatus status, bool active) {
        Initiator storage initiator =  _initiators[initiatorId];
        return (initiator.ownerAddress, initiator.operatorIds, initiator.validatorPublicKey, initiator.miniPoolAddress, initiator.status, initiator.active);
    }

    /**
     * @dev See {ISafeStakeRegistry-initiatorPreStatke}.
     */
    function initiatorPreStake(
        uint32 initiatorId,
        bytes calldata validatorPublicKey,
        address miniPoolAddress
    ) external override {
        _onlyInitiatorOwner(msg.sender, initiatorId);
        _initiators[initiatorId].validatorPublicKey = validatorPublicKey;
        _initiators[initiatorId].miniPoolAddress = miniPoolAddress;
        _initiators[initiatorId].status = InitiatorStatus.WAITING;

        emit InitiatorMiniPoolCreated(initiatorId, validatorPublicKey, miniPoolAddress);
    }

    function initiatorReady(
        uint32 initiatorId
    ) external override {
        _onlyInitiatorOwner(msg.sender, initiatorId);
        _initiators[initiatorId].status = InitiatorStatus.READY;
        emit InitiatorMiniPoolReady(initiatorId);
    }

    function initiatorStake(
        address ownerAddress,
        uint32 initiatorId
    ) external override {
        _onlyInitiatorOwner(ownerAddress, initiatorId);
        _initiators[initiatorId].status = InitiatorStatus.FINISHED;
    }

    function getInitiatorIdsByOwner(address ownerAddress) external view override returns (uint32[] memory initiatorIds) {
        return _initiatorsByOwnerAddress[ownerAddress];
    }

    function _onlyInitiatorOwner(address ownerAddress, uint32 initiatorId) private view {
        address initiatorOwner = _initiators[initiatorId].ownerAddress;

        if (ownerAddress != initiatorOwner) {
            revert CallerNotInitiatorOwner();
        }
    }

    function _checkTwoOperatorsFromParaDao(uint32[] calldata operatorIds) private view returns (bool) {
        uint8 count = 0; 
        for (uint32 index = 0; index < operatorIds.length; ++index) {
            uint32 operatorId = operatorIds[index];
            if (_operators[operatorId].fromParaStateDao) {
                ++count;
            }
        }
        return count >= 2;
    }

    function getOperatorsByInitiatorId(uint32 initiatorId) external view override returns (uint32[] memory operaotrIds) {
        return _initiators[initiatorId].operatorIds;
    }

    uint256[50] ______gap;
}

